import React from 'react';


class Users extends React.Component {
    users = [
        {
            id: 1,
            firstname: 'Bob',
            lastname: 'Marley',
            bio: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit.',
            age: 40,
            isHappy: true
        },
        {
            id: 2,
            firstname: 'John',
            lastname: 'Doe',
            bio: 'Lorem ipsum dolor sit amet consectetur, adipisicing elit.',
            age: 22,
            isHappy: false
        }
    ]
    render() {
        return (
            <div>
                {this.users.map((user) => (
                    <div>
                        <h3>{user.firstname} {user.lastname}</h3>
                        <p>{user.bio}</p>
                    </div>
                ))}
            </div>
        )
    }
}

export default Users;
